try {
    var isIE = function() {
        var myNav = navigator.userAgent.toLowerCase();
        return myNav.indexOf('msie') != -1 ? parseInt(myNav.split('msie')[1]) : false;
    };
    if (!isIE() || isIE() > 9) {
        var moduleName = 'animated-story',
            animationLength = '4',
            s3_prefix = '//s3.amazonaws.com/c3.taboola.com/ui-ab-tests/';
        if (!TRC[moduleName]) {
            TRC[moduleName] = {};
            var scriptPath = s3_prefix + moduleName + '/' + moduleName + '.js',
                CssPath = s3_prefix + moduleName + '/' + moduleName + '.css';
            TRC.net.loadScript(CssPath, 'css', null, null, true);
            (function() {
                TRC.net.loadScript(
                    scriptPath,
                    'js',
                    function() {
                        TRC[moduleName].Init(internalc,myorigin.mode,animationLength);
                    },
                    null,
                    true
                );
            })(internalc);
        }
        if (TRC[moduleName].ready) {
            TRC[moduleName].action(internalc);
            TRC[moduleName].listner && TRC[moduleName].listner.remove();
        } else {
            TRC[moduleName].listner = TRC.listen(moduleName + '-ready', function() {
                TRC[moduleName].ready = true;
                TRC[moduleName].action(internalc);
            });
        }
        var items = myorigin.container.getElementsByClassName('videoCube');
        for (let i = 0; i < items.length; i++) {
            Array.prototype.slice.call(items[i].querySelectorAll('a')).forEach(function(link) {
                TRC.dom.on(link, 'click', handleStoriesItemClick.bind(this));
            });
        }
        function handleStoriesItemClick(event) {
            var linkElement = event.currentTarget;
            if (!linkElement.getAttribute('data-click-sent')) {
                event.preventDefault();
                var data = {clickTimestamp: Date.now(), lastTransitionTimestamp: TRC['animated-story'].updateTime}; // get relavent timestamp
                TRCImpl.sendAbTestEvent('storiesItemsClicked', data, navigateToItemLink(linkElement));
            }
        }
        function navigateToItemLink(linkElement) {
            linkElement.setAttribute('data-click-sent', true);
            linkElement.click();
        }
    } else {
        console.log('widget disable');
        // is IE version 9 or less
    }
} catch (e) {
    console.error(e);
}
